                              <c style={{ color: "red" }}>* </c> dddd :
                            </label>

                            <Form.Item
                              name="username"
                              rules={[
                                {
                                  required: true,
                                  message: "กรุณากรอกชื่อผู้ใช้งาน",
                                },
                              ]}
                              hasFeedback
                            >
                              <Col span={4}>
                                <div style={style}>
