                              rules={[{ required: false }]}
                            >
                              <Col span={4}>
                                <div style={style}>
                                  <Input
                                    placeholder="๊facebook"
                                    style={{
                                      width: "600%",
                                      borderRadius: "0.5em",
                                    }}
                                  />
                                </div>
                              </Col>
                            </Form.Item>
                          </div>
                        </Col>

                        <Col span={4}>
                          <div style={style}>
                            <label style={{ fontSize: "3ch", color: "black" }}>
                              <FontAwesomeIcon
                                style={{
                                  color: "#4CAF50",
