                                      borderRadius: "0.5em",
                                    }}
                                  />
                                </div>
                              </Col>
                            </Form.Item>
                          </div>
                        </Col>
                      </Row>
                    </div>
                  </Form>
                  <br />
                  <Boxmenuber2 />
                  <br />
                  <Boxmenuber3 />
                </Content>
                <div style={{ textAlign: "center", paddingBottom: "50px" }}>
                  <div className="form-actions">
                    <button type="submit">Submit</button>
                  </div>
                </div>
              </div>
            </Registerpage>
          </Layout>
        </div>
      </form>
    );
  }
}
